    public ProductSubCategoryDTO oProductSubCategory = new ProductSubCategoryDTO();
    public string Message;
    public List<ProductCategoryDTO> Categories = new List<ProductCategoryDTO>();

    protected override async Task OnInitializedAsync()
    {
        try
        {
            var response = routerCategory.GetAll(false);
            if (response.IsSuccess)
            {
                Categories = response.Data.ToList();
            }
            else
            {
                Message = response.Message;
            }
        }
        catch (Exception e)
        {
            Message = e.InnerException.ToString();
        }

    }

    private void Save()
    {
        try
        {
            var response = router.Insert(oProductSubCategory);
            if (response.IsSuccess)
            {
                NavManager.NavigateTo("SubCategories/Index");
            }
            else
            {
                Message = response.Message;
            }
        }
        catch(Exception e)
        {
            Message = e.InnerException.ToString();
        }
    }

    private void BindCategoryId(ChangeEventArgs e)
    {
        try
        {
            var categoryId = Int32.Parse(e.Value.ToString());
            oProductSubCategory.ProductCategoryId = categoryId;
        }
        catch (Exception ex)
        {
            Message = ex.Message;
        }

    }


